var Ac4yLifecycleConstant=require("@ac4y/ac4y-lifecycle/constant/Ac4yLifecycleConstant.js");

var Ac4yLCDStock=require("@ac4y/ac4y-lifecycle/domain/Ac4yLCDStock.js");
var Ac4yLCDStation=require("@ac4y/ac4y-lifecycle/domain/Ac4yLCDStation.js");

var Ac4ySLCDState=require("./Ac4ySLCDState.js");
var Ac4ySLCDStep=require("./Ac4ySLCDStep.js");
var Ac4ySLCDStage=require("./Ac4ySLCDStage.js");

class Ac4ySLCDStock extends Ac4yLCDStock {
    
    constructor(object) {

        super(object);
        if (object != undefined && object === 0) return;

        this.put(new Ac4yLifecycleConstant().DIMENSION.state, new Ac4ySLCDState());
        this.put(new Ac4yLifecycleConstant().DIMENSION.step, new Ac4ySLCDStep());
        this.put(new Ac4yLifecycleConstant().DIMENSION.stage, new Ac4ySLCDStage());
        this.put(new Ac4yLifecycleConstant().DIMENSION.station, new Ac4yLCDStation());

    } // constructor
    
    createSelf(object) {return new Ac4ySLCDStock(object);}

} // Ac4ySLCDStock

module.exports=Ac4ySLCDStock
